import React from "react";
import {TouchableOpacity, Text, StyleSheet, TouchableOpacityProps} from 'react-native'

interface ISkillCaraProps extends TouchableOpacityProps {
    Codigo: string,
    Pais: string,

}

export function SkillCard({Codigo, Pais, ...rest}: ISkillCaraProps){
    return (
        <TouchableOpacity 
            //style={styles.buttonSkill} 
            //{...rest} 
        >
           <Text style={styles.textSkillNome}>
            {Codigo}
            </Text>
            <Text style={styles.textSkillemail}>
            {Pais}
            </Text>
       </TouchableOpacity>

       
        
    )
}
const styles = StyleSheet.create({
    buttonSkill: {
        backgroundColor: '#1f1e25',
        padding:15,
        borderRadius:15,
        alignItems: 'center',
        marginBottom: 15,
    },
    textSkillNome: {
        color: '#fff',
        fontSize: 30,
        fontWeight: 'bold'
    },
    textSkillemail: {
        color: '#fff',
        fontSize: 22,
        fontWeight: 'bold'
    },
    textSkillTelefone: {
        color: '#fff',
        fontSize: 15,
        fontWeight: 'bold'
    }
})
